  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset holds collection of reports
  for  Federal Service contract Inventory. Section 743 of Division C of the Fiscal
  Year 2010 Consolidated Appropriations Act, P.L. 111-117, requires civilian agencies
  to prepare an annual inventory of their service contracts. A service contract inventory
  assists an agency in better understanding how contracted services support the mission
  and operations and whether the contractorsu2019 skills are utilized in an appropriate
  manner. All service contracts over $25,000 awarded by the Social Security Administration
  from FY 2011 are included in this collection. The summary inventory lists the top
  ten product service codes by total dollar value from the inventory and special interest
  product service codes identified by the Office of Management and Budget.\",\n\t\"license_title\":
